import React from 'react';
import ReactDOM from 'react-dom';

//1.data show 2 types: 
//data render with the help of jsx
ReactDOM.render(<h1>Hello World!</h1>,
  document.getElementById("root"));

//pure javascript create new element
// var h1= document.createElement('h1');
// h1.innerHTML = "surbhi"
// document.getElementById("root").appendChild(h1);

//ReactDOM.render(kya dikhana hai,kaha dikhana hai,callback func);
//jyare pn render method no user karo tyare its only take one single element

//render method in multiple jsx element use karava 
ReactDOM.render(<div>
  <h1>Hello World!</h1>
  <p>THis is my first react project</p>
  <h2>jsx element</h2>
  </div>,
  document.getElementById("root"));

//in react v16 its possible for render () to return an array of element 
ReactDOM.render(
  [
  <h1>Hello World!</h1>,
  <p>THis is my first react project</p>,
  <h2>jsx element</h2>
],
  document.getElementById("root"));
